INSERT INTO `field_data_field_biography` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_biography_value`, `field_biography_format`) VALUES
('node', 'author', 0, 1, 1, 'und', 0, 'Alexander Sergeyevich Pushkin (Russian: Алекса́ндр Серге́евич Пу́шкин, tr. Aleksandr Sergeyevich Pushkin; IPA: [ɐlʲɪˈksandr sʲɪˈrɡʲejɪvʲɪt͡ɕ ˈpuʂkʲɪn] ( listen); 6 June [O.S. 26 May] 1799 – 10 February [O.S. 29 January] 1837) was a Russian author of the Romantic era[1] who is considered by many to be the greatest Russian poet[2][3][4][5] and the founder of modern Russian literature.[6][7]', NULL),
('node', 'author', 0, 3, 3, 'und', 0, 'Mikhail Yuryevich Lermontov (Russian: Михаи́л Ю́рьевич Ле́рмонтов; IPA: [mʲɪxɐˈil ˈjurʲjɪvʲɪtɕ ˈlʲɛrməntəf]; October 15 [O.S. October 3] 1814 – July 27 [O.S. July 15] 1841), a Russian Romantic writer, poet and painter, sometimes called "the poet of the Caucasus", became the most important Russian poet after Alexander Pushkin''s death in 1837. Lermontov is considered the supreme poet of Russian literature alongside Pushkin and the greatest figure in Russian Romanticism. His influence on later Russian literature is still felt in modern times, not only through his poetry, but also through his prose, which founded the tradition of the Russian psychological novel.', NULL),
('node', 'author', 0, 4, 4, 'und', 0, 'Mikhail Aleksandrovich Sholokhov (Russian: Михаи́л Алекса́ндрович Шо́лохов) (May 24 [O.S. May 11] 1905 – February 21, 1984) was a Soviet/Russian novelist and winner of the 1965 Nobel Prize in Literature. He is known for writing about life and fate of Don Cossacks during Russian revolution, Civil War and collectivization, primarily the famous And Quiet Flows the Don.', NULL),
('node', 'author', 0, 5, 5, 'und', 0, 'Count Lev Nikolayevich Tolstoy (Russian: Лев Никола́евич Толсто́й, pronounced [lʲef nʲɪkɐˈlaɪvʲɪt͡ɕ tɐlˈstoj] ( listen); 9 September [O.S. 28 August] 1828 – 20 November [O.S. 7 November] 1910), also known as Leo Tolstoy, was a Russian writer, philosopher and political thinker who primarily wrote novels and short stories. Tolstoy was a master of realistic fiction and is widely considered one of the greatest novelists of all time. He is best known for two long novels, War and Peace (1869) and Anna Karenina (1877). Tolstoy first achieved literary acclaim in his 20s with his semi-autobiographical trilogy of novels, Childhood, Boyhood, and Youth (1852–1856) and Sevastopol Sketches (1855), based on his experiences in the Crimean War. His fiction output also includes two additional novels, dozens of short stories, and several famous novellas, including The Death of Ivan Ilych, Family Happiness, and Hadji Murad. Later in life, he also wrote plays and essays. Tolstoy is equally known for his complicated and paradoxical persona and for his extreme moralistic and ascetic views, which he adopted after a moral crisis and spiritual awakening in the 1870s, after which he also became noted as a moral thinker and social reformer.', NULL),
('node', 'author', 0, 6, 6, 'und', 0, 'Yevgeny Petrov (Евгений Петров) was the pen name of Yevgeny Petrovich Katayev (Евгений Петрович Катаев; Ukrainian: Євген Петрович Катаєв; December 13 [O.S. November 30] 1903 in Odessa – July 2, 1942), a popular Soviet author in the 1920s and 1930s. He often worked in collaboration with Ilya Ilf (see Ilf and Petrov).\r\n\r\nAs Ilf and Petrov, Yevgeni Petrov and Ilya Ilf wrote The Twelve Chairs, released in 1928 and its sequel, The Little Golden Calf, released in 1931.\r\n\r\nHe was the brother of Valentin Katayev.\r\n\r\nFollowing Nazi Germany''s invasion of the Soviet Union, Petrov became a war correspondent. He was killed in a plane crash while returning from besieged Sevastopol. The short film Envelope was dedicated to Yevgeny.', NULL),
('node', 'author', 0, 7, 7, 'und', 0, 'Ilya Ilf, pseudonym of Iehiel-Leyb (Ilya) Arnoldovich Faynzilberg (Russian: Илья Арнольдович Файнзильберг, Ukrainian: Ієхієл-Лейб Арно́льдович Файнзільберг) (October 15 [O.S. October 3] 1897 in Odessa – April 13, 1937), was a popular Jewish Soviet author of the 1920s and 1930s, who worked in collaboration with Yevgeni Petrov as Ilf and Petrov.', NULL);
