INSERT INTO `field_revision_field_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_description_value`, `field_description_format`) VALUES
('node', 'book', 0, 2, 2, 'und', 0, 'The Captain''s Daughter (Russian: Капитанская дочка, Kapitanskaya dochka) is a historical novel by the Russian writer Alexander Pushkin. It was first published in 1836 in the fourth issue of the literary journal Sovremennik. The novel is a romanticized account of Pugachev''s Rebellion in 1773-1774.', NULL),
('node', 'book', 0, 8, 8, 'und', 0, 'The Golden Calf (Russian: Золотой телёнок, Zolotoy telyonok) is a famous satirical novel by Soviet authors Ilf and Petrov, released in 1931. Its main character Ostap Bender, also appeared in a previous novel by the authors called The Twelve Chairs. The title alludes to the "Golden calf" of the Bible; another possible rendering of it in English, less literal but better tuned to the air of the novel, would be "The Gilded Calf".\r\n\r\nThe novel was made into a 1968 black-and-white film The Little Golden Calf and 2006 eight-part TV series The Little Golden Calf.', NULL),
('node', 'book', 0, 9, 9, 'und', 0, 'The Twelve Chairs (Russian: Двенадцать стульев, Dvenadtsat stulyev) is a classic satirical novel by the Odessan Soviet authors Ilf and Petrov, released in 1928. Its main character Ostap Bender reappears in the book''s sequel The Little Golden Calf.', NULL),
('node', 'book', 0, 10, 10, 'und', 0, 'Eugene Onegin (Russian: Евге́ний Оне́гин, BGN/PCGN: Yevgeniy Onegin) is a novel in verse written by Alexander Pushkin.\r\n\r\nIt is a classic of Russian literature, and its eponymous protagonist has served as the model for a number of Russian literary heroes (so-called superfluous men). It was published in serial form between 1825 and 1832. The first complete edition was published in 1833, and the currently accepted version is based on the 1837 publication.\r\n\r\nAlmost the entire work is made up of 389 stanzas of iambic tetrameter with the unusual rhyme scheme "AbAbCCddEffEgg", where the uppercase letters represent feminine rhymes while the lowercase letters represent masculine rhymes. This form has come to be known as the "Onegin stanza" or the "Pushkin sonnet."\r\n\r\nThe rhythm, innovative rhyme scheme, the natural tone and diction, and the economical transparency of presentation all demonstrate the virtuosity which has been instrumental in proclaiming Pushkin as the undisputed master of Russian poetry.\r\n\r\nThe story is told by a narrator (a lightly fictionalized version of Pushkin''s public image), whose tone is educated, worldly, and intimate. The narrator digresses at times, usually to expand on aspects of this social and intellectual world. This allows for a development of the characters and emphasises the drama of the plot despite its relative simplicity.\r\n\r\nThe book is admired for the artfulness of its verse narrative as well as for its exploration of life, death, love, ennui, convention and passion.', NULL),
('node', 'book', 0, 11, 11, 'und', 0, 'Ruslan and Ludmila (Russian: Руслан и Людмила; Ruslan i Lyudmila) is a poem by Alexander Pushkin, published in 1820. It is written as an epic fairy tale consisting of a dedication (посвящение[1]), six "songs" (песни) or "cantos", and an epilogue (эпилог). It tells the story of the abduction of Ludmila, the daughter of Prince Vladimir of Kiev, by an evil wizard and the attempt by the brave knight Ruslan to find and rescue her.', NULL),
('node', 'book', 0, 12, 12, 'und', 0, 'Vladimir Dubrovsky is a young nobleman whose land is confiscated by a greedy and powerful aristocrat, Kirila Petrovitch Troekurov. Determined to get justice one way or another, Dubrovsky gathers a band of serfs and goes on the rampage, stealing from the rich and giving to the poor. Along the way, Dubrovsky falls in love with Masha, Troekurov’s daughter, and lets his guard down, with tragic results.', NULL),
('node', 'book', 0, 13, 13, 'und', 0, 'And Quiet Flows the Don or Quietly Flows the Don (Тихий Дон, literally "The Quiet Don") is an epic novel in four volumes by Russian writer Mikhail Aleksandrovich Sholokhov. The first three volumes were written from 1925 to 1932 and published in the Soviet magazine October in 1928–1932, and the fourth volume was finished in 1940. The English translation of the first three volumes appeared under this title in 1934.\r\n\r\nThe novel is considered one of the most significant works of Russian literature in the 20th century. It depicts the lives and struggles of Don Cossacks during the First World War, the Russian Revolution, and Russian Civil War. In 1965, Sholokhov was awarded the Nobel Prize for Literature for this novel. The authorship of the novel is contested by some literary critics and historians, who believe that it was written mostly not by Sholokhov.', NULL),
('node', 'book', 0, 14, 14, 'und', 0, 'War and Peace (Pre-reform Russian: «Война и миръ», Voyna i mir) is a novel by the Russian author Leo Tolstoy, first published in 1869. The work is epic in scale and is regarded as one of the most important works of world literature.[1][2][3] It is considered as Tolstoy''s finest literary achievement, along with his other major prose work, Anna Karenina (1873–1877).\r\n\r\nWar and Peace delineates in graphic detail events surrounding the French invasion of Russia, and the impact of the Napoleonic era on Tsarist society, as seen through the eyes of five Russian aristocratic families. Portions of an earlier version of the novel, then known as The Year 1805,[4] were serialized in the magazine The Russian Messenger between 1865 and 1867. The novel was first published in its entirety in 1869.[5] Newsweek in 2009 ranked it first in its list of the Top 100 Books.[6] In 2003, the novel was listed at number 20 on the BBC''s survey The Big Read.[7]\r\n\r\nTolstoy himself, somewhat enigmatically, said of War and Peace that it was "not a novel, even less is it a poem, and still less a historical chronicle". Large sections of the work, especially in the later chapters, are philosophical discussion rather than narrative.[8] He went on to elaborate that the best Russian literature does not conform to standard norms and hence hesitated to call War and Peace a novel. (Instead, Tolstoy regarded Anna Karenina as his first true novel.)', NULL),
('node', 'book', 0, 15, 15, 'und', 0, 'Anna Karenina (Russian: «Анна Каренина»; Russian pronunciation: [ˈanːə kɐˈrʲenʲɪnə])[1] is a novel by the Russian writer Leo Tolstoy, published in serial installments from 1873 to 1877 in the periodical The Russian Messenger. Tolstoy clashed with editor Mikhail Katkov over political issues that arose in the final installment (Tolstoy''s unpopular views of volunteers going to Serbia); therefore, the novel''s first complete appearance was in book form in 1878.\r\n\r\nWidely regarded as a pinnacle in realist fiction, Tolstoy considered Anna Karenina his first true novel, when he came to consider War and Peace to be more than a novel.\r\n\r\nFyodor Dostoyevsky declared it "flawless as a work of art." His opinion was shared by Vladimir Nabokov, who especially admired "the flawless magic of Tolstoy''s style," and by William Faulkner, who described the novel as, "the best ever written."[2] The novel is currently enjoying popularity, as demonstrated by a recent poll of 125 contemporary authors by J. Peder Zane, published in 2007 in "The Top Ten" in Time, which declared that Anna Karenina is the "greatest novel ever written."[3]', NULL),
('node', 'book', 0, 16, 16, 'und', 0, 'Sevastopol Sketches (Russian: Севастопольские рассказы, Sevastopolskiye rasskazy) are three short stories written by Leo Tolstoy and published in 1855 to record his experiences during the Siege of Sevastopol (1854–1855). The name originates from Sevastopol, a city in Crimea. The book has also been released under the anglicized title The Sebastopol Sketches and is sometimes titled Sevastopol Stories. These brief "sketches" formed the basis of many of the episodes in Tolstoy''s magnum opus, War and Peace.', NULL),
('node', 'book', 0, 17, 17, 'und', 0, 'A Hero of Our Time (Russian: Герой нашего времени, Geroy nashevo vremeni) is a novel by Mikhail Lermontov, written in 1839 and revised in 1841.\r\n\r\nIt is an example of the superfluous man novel, noted for its compelling Byronic hero (or anti-hero) Pechorin and for the beautiful descriptions of the Caucasus. There are several English translations, including one by Vladimir Nabokov and Dmitri Nabokov in 1958.', NULL),
('node', 'book', 0, 18, 18, 'und', 0, 'Young Yuri Volin has to make a difficult choice between staying with his rich, overprotective grandmother and departing to Germany with his financially struggling father. Yuri is passionately in love with one of his two cousins, Lyubov, who admits she loves him too.\r\n\r\nEnter the scene – scheming housemaid Darya with her own vile recipe for making the boy stay at home, and the latter''s uncle who finds out about Yuri''s romantic leanings towards his daughter and is outraged with the idea of two cousins being in love. As a result of Darya''s intrigue, the boy gets cursed by his misguided father (who believes the rumours of his son''s two-facedness). Becoming a witness to Lyubov''s clandestine conversation with Zarutsky and (mistakenly) construing it as a sign of infidelity on her part, the young man first challenges his hussar friend to a duel, then commits suicide.[3]', NULL),
('node', 'book', 0, 19, 19, 'und', 0, 'A Strange Man is a self-described ''romantic drama'', largely autobiographical and closely linked to its predecessor, Menschen und Liedenschaften (1830). Part of Yuri Volin''s ''sacrilegious'' monologue is being reproduced here, now as Vladimir Arbenin''s speech, as well as another scene where servant Ivan refuses to accept the money from his master and the latter throws the wallet into the window. Arbenin in the play is a poet and several poems written by young Lermontov are ascribed to the protagonist.[1] The autobiographical aspect of it is stressed in the author''s introduction: "I decided to tell the drama that was real... Characters featured here have been taken from the real life."[2]', NULL),
('node', 'book', 0, 20, 20, 'und', 0, 'The hero of the drama, Arbenin, is a wealthy young man endowed with a rebellious spirit and a strong will. Born into high society, he strives in vain to gain independence and freedom. He lives by the laws of his society, and, in trying to defend his honor while blinded by jealousy and pride, ends up murdering his wife.', NULL),
('node', 'book', 0, 21, 21, 'und', 0, 'The first scene of the poem describes a banquet at Tsar''s palace. Ivan The Terrible is strictly watching his Boyars and Oprichnicks and suddenly notices that young Oprichnik named Kiribeevich doesn''t eat or drink anything and doesn''t seem to enjoy the feast. When asked for reason, Kiribeevich tells Tsar that he felt in love with a girl named Alena Dmitrevna. Ivan wants to help his favorite Oprichnik to organize the wedding and gives him expensive jewelry to be gifted to his future bride. But Kiribeevich doesn''t mention the fact that Alena Dmitrevna is already married to a merchant named Stepan Kalashnikov.', NULL),
('node', 'book', 0, 22, 22, 'und', 0, 'The poem is set in Lermontov''s beloved Caucasus Mountains. It opens with the eponymous protagonist wandering the earth, hopeless and troubled. He dwells in infinite isolation, his immortality and unlimited power a worthless burden. Then he espies the beautiful Georgian[4] Princess Tamara, dancing for her wedding, and in the desert of his soul wells an indescribable emotion.', NULL),
('node', 'book', 0, 23, 23, 'und', 0, 'The Battle of the Valerik River was fought on July 11, 1840, between the Imperial Russian Army and Chechen mountain tribesman, as part of the Russian conquest of the Caucasus.\r\n\r\nMikhail Lermontov, a lieutenant in the Tenginsky Regiment, showed exemplary valor in the battle. Eyewitness accounts describe him astride a white horse, leading his men into battle with reckless abandon', NULL);
