INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' aspushkin alexander pushkin sunday may 26 1799 sunday january 29 1837 alexander sergeyevich pushkin russian алекса́ндр серге́евич пу́шкин tr aleksandr sergeyevich pushkin ipa ɐlʲɪˈksandr sʲɪˈrɡʲejɪvʲɪt͡ɕ ˈpuʂkʲɪn listen 6 june os 26 may 1799 10 february os 29 january 1837 was a russian author of the romantic era 1 who is considered by many to be the greatest russian poet 2345 and the founder of modern russian literature 67   aspushkin aspushkin aspushkin aspushkin  ', 0),
(2, 'node', ' the captain s daughter 1836 literaturemd drama aspushkin the captain s daughter the captain s daughter russian капитанская дочка kapitanskaya dochka is a historical novel by the russian writer alexander pushkin it was first published in 1836 in the fourth issue of the literary journal sovremennik the novel is a romanticized account of pugachev s rebellion in 17731774  ', 0),
(3, 'node', ' mikhail lermontov mikhail yuryevich lermontov saturday october 15 1814 tuesday july 27 1841 mikhail yuryevich lermontov russian михаи́л ю́рьевич ле́рмонтов ipa mʲɪxɐˈil ˈjurʲjɪvʲɪtɕ ˈlʲɛrməntəf october 15 os october 3 1814 july 27 os july 15 1841 a russian romantic writer poet and painter sometimes called the poet of the caucasus became the most important russian poet after alexander pushkin s death in 1837 lermontov is considered the supreme poet of russian literature alongside pushkin and the greatest figure in russian romanticism his influence on later russian literature is still felt in modern times not only through his poetry but also through his prose which founded the tradition of the russian psychological novel  mikhail lermontov mikhail lermontov mikhail lermontov mikhail lermontov mikhail lermontov mikhail lermontov mikhail lermontov  ', 0),
(4, 'node', ' mikhail sholokhov mikhail aleksandrovich sholokhov wednesday may 24 1905 tuesday february 21 1984 mikhail aleksandrovich sholokhov russian михаи́л алекса́ндрович шо́лохов may 24 os may 11 1905 february 21 1984 was a soviet russian novelist and winner of the 1965 nobel prize in literature he is known for writing about life and fate of don cossacks during russian revolution civil war and collectivization primarily the famous and quiet flows the don  mikhail sholokhov  ', 0),
(5, 'node', ' leo tolstoy lev nikolayevich tolstoy monday september 8 1828 sunday november 20 1910 count lev nikolayevich tolstoy russian лев никола́евич толсто́й pronounced lʲef nʲɪkɐˈlaɪvʲɪt͡ɕ tɐlˈstoj listen 9 september os 28 august 1828 20 november os 7 november 1910 also known as leo tolstoy was a russian writer philosopher and political thinker who primarily wrote novels and short stories tolstoy was a master of realistic fiction and is widely considered one of the greatest novelists of all time he is best known for two long novels war and peace 1869 and anna karenina 1877 tolstoy first achieved literary acclaim in his 20s with his semiautobiographical trilogy of novels childhood boyhood and youth 18521856 and sevastopol sketches 1855 based on his experiences in the crimean war his fiction output also includes two additional novels dozens of short stories and several famous novellas including the death of ivan ilych family happiness and hadji murad later in life he also wrote plays and essays tolstoy is equally known for his complicated and paradoxical persona and for his extreme moralistic and ascetic views which he adopted after a moral crisis and spiritual awakening in the 1870s after which he also became noted as a moral thinker and social reformer  leo tolstoy leo tolstoy leo tolstoy  ', 0),
(6, 'node', ' yevgeny petrov evgeny petrovich katayev sunday november 30 1902 thursday july 2 1942 yevgeny petrov евгений петров was the pen name of yevgeny petrovich katayev евгений петрович катаев ukrainian євген петрович катаєв december 13 os november 30 1903 in odessa july 2 1942 a popular soviet author in the 1920s and 1930s he often worked in collaboration with ilya ilf see ilf and petrov as ilf and petrov yevgeni petrov and ilya ilf wrote the twelve chairs released in 1928 and its sequel the little golden calf released in 1931 he was the brother of valentin katayev following nazi germany s invasion of the soviet union petrov became a war correspondent he was killed in a plane crash while returning from besieged sevastopol the short film envelope was dedicated to yevgeny  yevgeny petrov yevgeny petrov  ', 0),
(7, 'node', ' ilya ilf iehielleyb ilya arnoldovich faynzilberg sunday october 3 1897 tuesday april 13 1937 ilya ilf pseudonym of iehielleyb ilya arnoldovich faynzilberg russian илья арнольдович файнзильберг ukrainian ієхієллейб арно́льдович файнзільберг october 15 os october 3 1897 in odessa april 13 1937 was a popular jewish soviet author of the 1920s and 1930s who worked in collaboration with yevgeni petrov as ilf and petrov  ilya ilf ilya ilf  ', 0),
(8, 'node', ' the little golden calf 1931 peoplelit romantic ilya ilf yevgeny petrov the golden calf the golden calf russian золотой телёнок zolotoy telyonok is a famous satirical novel by soviet authors ilf and petrov released in 1931 its main character ostap bender also appeared in a previous novel by the authors called the twelve chairs the title alludes to the golden calf of the bible another possible rendering of it in english less literal but better tuned to the air of the novel would be the gilded calf the novel was made into a 1968 blackandwhite film the little golden calf and 2006 eightpart tv series the little golden calf  ', 0),
(9, 'node', ' the twelve chairs 1928 peoplelit romantic ilya ilf yevgeny petrov the twelve chairs the twelve chairs russian двенадцать стульев dvenadtsat stulyev is a classic satirical novel by the odessan soviet authors ilf and petrov released in 1928 its main character ostap bender reappears in the book s sequel the little golden calf  ', 0),
(10, 'node', ' eugene onegin 1825 literaturemd novel aspushkin eugene onegin eugene onegin russian евге́ний оне́гин bgn pcgn yevgeniy onegin is a novel in verse written by alexander pushkin it is a classic of russian literature and its eponymous protagonist has served as the model for a number of russian literary heroes socalled superfluous men it was published in serial form between 1825 and 1832 the first complete edition was published in 1833 and the currently accepted version is based on the 1837 publication almost the entire work is made up of 389 stanzas of iambic tetrameter with the unusual rhyme scheme ababccddeffegg where the uppercase letters represent feminine rhymes while the lowercase letters represent masculine rhymes this form has come to be known as the onegin stanza or the pushkin sonnet the rhythm innovative rhyme scheme the natural tone and diction and the economical transparency of presentation all demonstrate the virtuosity which has been instrumental in proclaiming pushkin as the undisputed master of russian poetry the story is told by a narrator a lightly fictionalized version of pushkin s public image whose tone is educated worldly and intimate the narrator digresses at times usually to expand on aspects of this social and intellectual world this allows for a development of the characters and emphasises the drama of the plot despite its relative simplicity the book is admired for the artfulness of its verse narrative as well as for its exploration of life death love ennui convention and passion  ', 0),
(11, 'node', ' ruslan and ludmila 1820 literaturemd poetry aspushkin ruslan and ludmila ruslan and ludmila russian руслан и людмила ruslan i lyudmila is a poem by alexander pushkin published in 1820 it is written as an epic fairy tale consisting of a dedication посвящение 1 six songs песни or cantos and an epilogue эпилог it tells the story of the abduction of ludmila the daughter of prince vladimir of kiev by an evil wizard and the attempt by the brave knight ruslan to find and rescue her  ', 0),
(12, 'node', ' dubrovsky 1841 literaturemd prose aspushkin dubrovsky vladimir dubrovsky is a young nobleman whose land is confiscated by a greedy and powerful aristocrat kirila petrovitch troekurov determined to get justice one way or another dubrovsky gathers a band of serfs and goes on the rampage stealing from the rich and giving to the poor along the way dubrovsky falls in love with masha troekurov s daughter and lets his guard down with tragic results  ', 0),
(13, 'node', ' and quiet flows the don 1928 molbook ballad mikhail sholokhov and quiet flows the don and quiet flows the don or quietly flows the don тихий дон literally the quiet don is an epic novel in four volumes by russian writer mikhail aleksandrovich sholokhov the first three volumes were written from 1925 to 1932 and published in the soviet magazine october in 19281932 and the fourth volume was finished in 1940 the english translation of the first three volumes appeared under this title in 1934 the novel is considered one of the most significant works of russian literature in the 20th century it depicts the lives and struggles of don cossacks during the first world war the russian revolution and russian civil war in 1965 sholokhov was awarded the nobel prize for literature for this novel the authorship of the novel is contested by some literary critics and historians who believe that it was written mostly not by sholokhov  ', 0),
(14, 'node', ' war and peace 1869 molbook novel leo tolstoy war and peace war and peace prereform russian война и миръ voyna i mir is a novel by the russian author leo tolstoy first published in 1869 the work is epic in scale and is regarded as one of the most important works of world literature 123 it is considered as tolstoy s finest literary achievement along with his other major prose work anna karenina 18731877 war and peace delineates in graphic detail events surrounding the french invasion of russia and the impact of the napoleonic era on tsarist society as seen through the eyes of five russian aristocratic families portions of an earlier version of the novel then known as the year 18054 were serialized in the magazine the russian messenger between 1865 and 1867 the novel was first published in its entirety in 18695 newsweek in 2009 ranked it first in its list of the top 100 books 6 in 2003 the novel was listed at number 20 on the bbc s survey the big read 7 tolstoy himself somewhat enigmatically said of war and peace that it was not a novel even less is it a poem and still less a historical chronicle large sections of the work especially in the later chapters are philosophical discussion rather than narrative 8 he went on to elaborate that the best russian literature does not conform to standard norms and hence hesitated to call war and peace a novel instead tolstoy regarded anna karenina as his first true novel  ', 0),
(15, 'node', ' anna karenina 1877 molbook drama leo tolstoy anna karenina anna karenina russian анна каренина russian pronunciation ˈanːə kɐˈrʲenʲɪnə 1 is a novel by the russian writer leo tolstoy published in serial installments from 1873 to 1877 in the periodical the russian messenger tolstoy clashed with editor mikhail katkov over political issues that arose in the final installment tolstoy s unpopular views of volunteers going to serbia therefore the novel s first complete appearance was in book form in 1878 widely regarded as a pinnacle in realist fiction tolstoy considered anna karenina his first true novel when he came to consider war and peace to be more than a novel fyodor dostoyevsky declared it flawless as a work of art his opinion was shared by vladimir nabokov who especially admired the flawless magic of tolstoy s style and by william faulkner who described the novel as the best ever written 2 the novel is currently enjoying popularity as demonstrated by a recent poll of 125 contemporary authors by j peder zane published in 2007 in the top ten in time which declared that anna karenina is the greatest novel ever written 3  ', 0),
(16, 'node', ' sevastopol sketches 1855 molbook novel leo tolstoy sevastopol sketches sevastopol sketches russian севастопольские рассказы sevastopolskiye rasskazy are three short stories written by leo tolstoy and published in 1855 to record his experiences during the siege of sevastopol 18541855 the name originates from sevastopol a city in crimea the book has also been released under the anglicized title the sebastopol sketches and is sometimes titled sevastopol stories these brief sketches formed the basis of many of the episodes in tolstoy s magnum opus war and peace  ', 0),
(17, 'node', ' a hero of our time 1840 peoplelit prose mikhail lermontov a hero of our time a hero of our time russian герой нашего времени geroy nashevo vremeni is a novel by mikhail lermontov written in 1839 and revised in 1841 it is an example of the superfluous man novel noted for its compelling byronic hero or antihero pechorin and for the beautiful descriptions of the caucasus there are several english translations including one by vladimir nabokov and dmitri nabokov in 1958  ', 0),
(18, 'node', ' menschen und leidenschaften 1880 peoplelit drama mikhail lermontov menschen und leidenschaften young yuri volin has to make a difficult choice between staying with his rich overprotective grandmother and departing to germany with his financially struggling father yuri is passionately in love with one of his two cousins lyubov who admits she loves him too enter the scene scheming housemaid darya with her own vile recipe for making the boy stay at home and the latter s uncle who finds out about yuri s romantic leanings towards his daughter and is outraged with the idea of two cousins being in love as a result of darya s intrigue the boy gets cursed by his misguided father who believes the rumours of his son s twofacedness becoming a witness to lyubov s clandestine conversation with zarutsky and mistakenly construing it as a sign of infidelity on her part the young man first challenges his hussar friend to a duel then commits suicide 3  ', 0),
(19, 'node', ' a strange man 1860 peoplelit drama mikhail lermontov a strange man a strange man is a selfdescribed romantic drama largely autobiographical and closely linked to its predecessor menschen und liedenschaften 1830 part of yuri volin s sacrilegious monologue is being reproduced here now as vladimir arbenin s speech as well as another scene where servant ivan refuses to accept the money from his master and the latter throws the wallet into the window arbenin in the play is a poet and several poems written by young lermontov are ascribed to the protagonist 1 the autobiographical aspect of it is stressed in the author s introduction i decided to tell the drama that was real characters featured here have been taken from the real life 2  ', 0),
(20, 'node', ' masquerade 1830 literaturemd romantic mikhail lermontov masquerade the hero of the drama arbenin is a wealthy young man endowed with a rebellious spirit and a strong will born into high society he strives in vain to gain independence and freedom he lives by the laws of his society and in trying to defend his honor while blinded by jealousy and pride ends up murdering his wife  ', 0),
(21, 'node', ' the song of the merchant kalashnikov 1838 peoplelit poetry mikhail lermontov the song of the merchant kalashnikov the first scene of the poem describes a banquet at tsar s palace ivan the terrible is strictly watching his boyars and oprichnicks and suddenly notices that young oprichnik named kiribeevich doesn t eat or drink anything and doesn t seem to enjoy the feast when asked for reason kiribeevich tells tsar that he felt in love with a girl named alena dmitrevna ivan wants to help his favorite oprichnik to organize the wedding and gives him expensive jewelry to be gifted to his future bride but kiribeevich doesn t mention the fact that alena dmitrevna is already married to a merchant named stepan kalashnikov  ', 0),
(22, 'node', ' demon 1829 peoplelit ballad mikhail lermontov demon the poem is set in lermontov s beloved caucasus mountains it opens with the eponymous protagonist wandering the earth hopeless and troubled he dwells in infinite isolation his immortality and unlimited power a worthless burden then he espies the beautiful georgian 4 princess tamara dancing for her wedding and in the desert of his soul wells an indescribable emotion  ', 0),
(23, 'node', ' valerik 1843 literaturemd poetry mikhail lermontov valerik the battle of the valerik river was fought on july 11 1840 between the imperial russian army and chechen mountain tribesman as part of the russian conquest of the caucasus mikhail lermontov a lieutenant in the tenginsky regiment showed exemplary valor in the battle eyewitness accounts describe him astride a white horse leading his men into battle with reckless abandon  ', 0);
